import React from 'react';
import Dashboard from './Components/Dashboard/Dashboard';
import Header from './Components/Header/Header';
import InputForm from './Components/InputForm/InputForm';

const App = () => {
  return (
    <div>
      <Header/>
      <InputForm/>
      <Dashboard/>
    </div>
  );
}

export default App;
